-- Setting NOCOUNT ON suppresses completion messages
SET NOCOUNT ON

-- Set date format to month, day, year
SET DATEFORMAT mdy;

-- Make the master database the current database
USE master

-- If CHDB database exists, drop it
IF EXISTS (SELECT  * FROM sysdatabases WHERE name = 'CHDB')
  DROP DATABASE CHDB;
GO

-- Create the CHDB database
CREATE DATABASE CHDB;
GO

-- Make the CHDB database the current database
USE CHDB;

-- Create departments table
CREATE TABLE departments (
	department_id INT PRIMARY KEY,
	department_name VARCHAR(30) NOT NULL,
	manager_first_name VARCHAR(30),
	manager_last_name VARCHAR(30));

-- Create medications table
CREATE TABLE medications (
	medication_id INT PRIMARY KEY ,
	medication_description VARCHAR(25) NOT NULL,
	medication_cost DECIMAL(9, 2) CHECK (medication_cost > 0),
	package_size VARCHAR(20) ,
	strength VARCHAR(20) ,
	sig VARCHAR(20) ,
	units_used_ytd INT ,
	last_prescribed_date DATE);

-- Create nursing units table
CREATE TABLE nursing_units (
	nursing_unit_id VARCHAR(10) PRIMARY KEY,
	specialty VARCHAR(20) NOT NULL,
	manager_first_name VARCHAR(30),
	manager_last_name VARCHAR(30),
	beds INT CHECK (beds > 0),
	extension INT);

-- Create physicians table
CREATE TABLE physicians (
	physician_id INT PRIMARY KEY,
	first_name VARCHAR(30),
	last_name VARCHAR(30),
	specialty VARCHAR(25),
	phone VARCHAR(15),
	ohip_registration INT);

-- Create provinces table
CREATE TABLE provinces (
	province_id CHAR(2) PRIMARY KEY,
	province_name VARCHAR(30) NOT NULL);

-- Create patients table
CREATE TABLE patients (
	patient_id INT PRIMARY KEY,
	first_name VARCHAR(30),
	last_name VARCHAR(30),
	gender CHAR(1),
	birth_date DATE,
	street_address VARCHAR(30),
	city VARCHAR(30),
	province_id CHAR(2) FOREIGN KEY REFERENCES provinces (province_id),
	postal_code VARCHAR(7),
	health_card_num BIGINT,
	allergies VARCHAR(80),
	patient_height DECIMAL(3, 0) CHECK (patient_height > 0),
	patient_weight DECIMAL(4, 0) CHECK (patient_weight > 0));

-- Create vendors table
CREATE TABLE vendors (
	vendor_id INT PRIMARY KEY,
	vendor_name VARCHAR(30) NOT NULL,
	street_address VARCHAR(30),
	city VARCHAR(30),
	province_id CHAR(2) FOREIGN KEY REFERENCES provinces (province_id),
	postal_code VARCHAR(7),
	contact_first_name VARCHAR(30),
	contact_last_name VARCHAR(30),
	purchases_ytd DECIMAL(9, 2));

-- Create admissions table
CREATE TABLE admissions (
	patient_id INT FOREIGN KEY REFERENCES patients (patient_id),
	admission_date DATE,
	discharge_date DATE,
	primary_diagnosis VARCHAR(50),
	secondary_diagnoses VARCHAR(240),
	attending_physician_id INT FOREIGN KEY REFERENCES physicians (physician_id),
	nursing_unit_id VARCHAR(10) FOREIGN KEY REFERENCES nursing_units (nursing_unit_id),
	room INT,
	bed INT,
	CONSTRAINT pk_admissions PRIMARY KEY (patient_id, admission_date));

-- Create encounters table
CREATE TABLE encounters (
	patient_id INT FOREIGN KEY REFERENCES patients (patient_id),
	physician_id INT FOREIGN KEY REFERENCES physicians (physician_id),
	encounter_date_time DATETIME,
	notes VARCHAR(250),
	CONSTRAINT pk_encounters PRIMARY KEY (patient_id, physician_id, encounter_date_time));

-- Create items table
CREATE TABLE items (
	item_id INT PRIMARY KEY,
	item_description VARCHAR(30) NOT NULL,
	item_cost DECIMAL(9, 2),
	quantity_on_hand INT,
	usage_ytd INT,
	primary_vendor_id INT FOREIGN KEY REFERENCES vendors (vendor_id),
	order_quantity INT,
	order_point INT);

-- Create purchase orders table
CREATE TABLE purchase_orders (
	purchase_order_id INT PRIMARY KEY,
	order_date DATE NOT NULL,
	department_id INT FOREIGN KEY REFERENCES departments (department_id),
	vendor_id INT FOREIGN KEY REFERENCES vendors (vendor_id),
	total_amount DECIMAL(9, 2),
	order_status VARCHAR(10));

-- Create unit dose orders table
CREATE TABLE unit_dose_orders (
	unit_dose_order_id INT PRIMARY KEY,
	patient_id INT NOT NULL FOREIGN KEY REFERENCES patients (patient_id),
	medication_id INT NOT NULL FOREIGN KEY REFERENCES medications (medication_id),
	dosage VARCHAR(20),
	sig VARCHAR(20),
	dosage_route VARCHAR(10),
	pharmacist_initials CHAR(3) NOT NULL,
	entered_date DATE);

-- Create purchase order lines table
CREATE TABLE purchase_order_lines (
	purchase_order_id INT FOREIGN KEY REFERENCES purchase_orders (purchase_order_id),
	line_num INT,
	item_id INT FOREIGN KEY REFERENCES items (item_id),
	quantity INT NOT NULL,
	unit_cost DECIMAL(9, 2),
	received INT,
	cancelled INT,
	last_arrived_date DATE NULL,
	CONSTRAINT pk_purchase_order_lines PRIMARY KEY (purchase_order_id, line_num));
GO

